import React from "react";
import "./App.css";
import space from "../public/space.png";
function App() {
  return (
    <div className="App">
      <header id="App-header">
        <div className="App-header-title">DISCOVERY</div>
        <div className="App-header-item-row">
          <div
            className="App-header-item"
            onMouseOver={() => {
              document.getElementById("App-header").style.backgroundImage = "";
            }}
          >
            The World
          </div>
          <div className="App-header-item">Language</div>
          <div className="App-header-item">Stories</div>
          <div className="App-header-item">Creative</div>
        </div>
      </header>
    </div>
  );
}

export default App;
